import React, { Component } from 'react';
import Svg from "./blogging.svg";

const Home =() => {
	return ( 
		<>
  <section id="header" className="align-items-center">
    <div className="container-fluid nav_bg">
  <div className="row">
    <div className="col-10 mx-auto ">
    
    <div className="row">
    
    <div className="col-md-6 pt-5 pt-lg-0 text-white order-1 order-lg-1 justify-content-center flex-column">
    <h1 className="">Feel free to connect with <strong className="brand-name">Audonix</strong></h1>
    <p className="my-3">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
    <a href="#" className="btn btn-outline-light rounded-pill mt-3">Get started</a>
    </div>
    
    <div className="col-lg-6 order-2 order-lg-2">
       <img src={Svg} alt="home image" className="img-fluid" width="80%" />
    </div>
   
    
    </div>

    </div>
  
  </div>
</div>
 </section>


		
		
			
		</>
		);
};

export default Home;
